import React, { Component } from 'react';

class App extends Component {
  componentDidMount = ()=>{
    fetch('/article/fetch/user.json')
    .then(function(response) {
      alert(response.headers.get('Content-Type'));
      alert(response.status);

      return response.json();
    })
    .then(function(user) {
      alert(user.name);
    })
    .catch( alert );
  }

  render() {
    return (
      <div className="App">
        <h1>hello</h1>
      </div>
    );
  }
}

export default App;
